textOriginal:
Tudo aconteceu por que nossa Suprema Corte não observa o que prediz a Constituição :
Art. 220. A manifestação do pensamento, a criação, a expressão e a informação, sob qualquer forma, processo ou veículo não sofrerão qualquer restrição, observado o disposto nesta Constituição . 

§ 1º Nenhuma lei conterá dispositivo que possa constituir embaraço à plena liberdade de informação jornalística em qualquer veículo de comunicação social; § 2º É vedada toda e qualquer censura de natureza política, ideológica e artística. 
Art. 5º :
IV - é livre a manifestação do pensamento, sendo vedado o anonimato; V - é assegurado o direito de resposta, proporcional ao agravo, além da indenização por dano material, moral ou à imagem;
X - são invioláveis a intimidade, a vida privada, a honra e a imagem das pessoas, assegurado o direito a indenização pelo dano material ou moral decorrente de sua violação;
XIV - é assegurado a todos o acesso à informação e resguardado o sigilo da fonte, quando necessário ao exercício profissional;

É interessante transcrever o texto de lei Constitucional, em seu artigo 5º, inciso LIV, assim afirma: „‟ninguém será privado da liberdade ou de seus bens sem o devido processo legal„‟,
O princípio da inércia da jurisdição diz que a justiça só age quando acionada pela parte, ou seja, ela é inerte. Desta forma, podemos dizer que a jurisdição atual, o juiz pode agir somente quando provocado pela interessado.
Resumidamente podemos dizer que: A legislação dispõe sobre a proibição de iniciativa do juiz para produção de provas- ou seja, o juiz não pode agir de oficio (ele se manifestará quando requerido)....O juiz não pode portanto, assumir o papel de órgão de acusação (Ministério Público). Este magistrado deverá garantir a legalidade da investigação e salva guarda dos direitos do acusado.
